import React from 'react';
import IoT from './IoT.png'
import './Logo.css';

const Logo =()=>
{
	return(
    <div className='ma4 mt0'>
      <div className="pa3"><img alt='logo' src={IoT}/></div>
    <p className='f2'>Internet of Things</p>
    </div>

    );
}

export default Logo;
